import React from 'react';
function App() {
  return (
    <div style={{ padding: '20px', maxWidth: '600px', margin: '0 auto' }}>
      <h1>Prédiction du prix de voiture</h1>

      <form style={{ display: 'grid', gap: '15px' }}>
        <div>
          <label>Kilométrage</label>
          <input type="number" style={{ width: '100%', padding: '8px' }} />
        </div>

        {/* Ajoutez tous vos autres champs ici */}

        <button
          type="submit"
          style={{
            padding: '10px',
            background: 'blue',
            color: 'white',
            border: 'none'
          }}
        >
          Prédire
        </button>
      </form>
    </div>
  );
}
